import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import './App.css';

// Components
import Navbar from './components/layout/Navbar';
import Footer from './components/layout/Footer';
import HomePage from './components/pages/HomePage';

// Product Components
import ProductsList from './components/products/ProductsList';
import ProductDetail from './components/products/ProductDetail';
import AddProduct from './components/products/AddProduct';
import EditProduct from './components/products/EditProduct';

// Order Components
import OrdersList from './components/orders/OrdersList';
import OrderDetail from './components/orders/OrderDetail';
import AddOrder from './components/orders/AddOrder';
import EditOrder from './components/orders/EditOrder';

// Customer Components
import CustomersList from './components/customers/CustomersList';
import CustomerDetail from './components/customers/CustomerDetail';
import AddCustomer from './components/customers/AddCustomer';
import EditCustomer from './components/customers/EditCustomer';
import Login from './components/auth/Login';
import Register from './components/auth/Register';

// Cart Components
import Cart from './components/cart/Cart';
import Checkout from './components/cart/Checkout';

// Seller Components
import SellersList from './components/sellers/SellersList';
import SellerDetail from './components/sellers/SellerDetail';
import AddSeller from './components/sellers/AddSeller';
import EditSeller from './components/sellers/EditSeller';

function App() {
  return (
    <Router>
      <div className="flex flex-col min-h-screen">
        <Navbar />
        <main className="flex-grow container mx-auto px-4 py-8">
          <Routes>
            <Route path="/" element={<HomePage />} />
            
            {/* Product Routes */}
            <Route path="/products" element={<ProductsList />} />
            <Route path="/products/:id" element={<ProductDetail />} />
            <Route path="/products/add" element={<AddProduct />} />
            <Route path="/products/edit/:id" element={<EditProduct />} />
            
            {/* Order Routes */}
            <Route path="/orders" element={<OrdersList />} />
            <Route path="/orders/:id" element={<OrderDetail />} />
            <Route path="/orders/add" element={<AddOrder />} />
            <Route path="/orders/edit/:id" element={<EditOrder />} />
            
            {/* Customer Routes */}
            <Route path="/customers" element={<CustomersList />} />
            <Route path="/customers/:id" element={<CustomerDetail />} />
            <Route path="/customers/add" element={<AddCustomer />} />
            <Route path="/customers/edit/:id" element={<EditCustomer />} />
            <Route path="/login" element={<Login />} />
            <Route path="/register" element={<Register />} />
            
            {/* Seller Routes */}
            <Route path="/sellers" element={<SellersList />} />
            <Route path="/sellers/:id" element={<SellerDetail />} />
            <Route path="/sellers/add" element={<AddSeller />} />
            <Route path="/sellers/edit/:id" element={<EditSeller />} />
            
            {/* Cart Route */}
            <Route path="/cart" element={<Cart />} />
          </Routes>
        </main>
        <Footer />
      </div>
    </Router>
  );
}

export default App;
